// Contact.jsx

import React from 'react';
import { FaEnvelope, FaPhone, FaMapMarkerAlt } from 'react-icons/fa'; // 아이콘을 사용하기 위한 라이브러리

const Contact = () => {
  const email = 'your.email@example.com';
  const phoneNumber = '+1 123 456 7890';
  const address = '123 Main St, City, Country';

  return (
    <div className="contact-container">
      <h2>Contact Us</h2>
      <p>If you have any questions or concerns, feel free to reach out to us through various channels:</p>

      <div className="contact-method">
        <FaEnvelope />
        <p>Email: <a href={`mailto:${email}`}>{email}</a></p>
      </div>

      <div className="contact-method">
        <FaPhone />
        <p>Phone: <a href={`tel:${phoneNumber}`}>{phoneNumber}</a></p>
      </div>

      <div className="contact-method">
        <FaMapMarkerAlt />
        <p>Address: {address}</p>
      </div>

      <p>We're here to assist you and look forward to hearing from you!</p>
    </div>
  );
};

export default Contact;
